import React, { useState } from "react";
import "../App.css";
import { FaGithub } from 'react-icons/fa';  // Importing GitHub icon from react-icons

function ProjectsDisplay() {

    const img_styles = {       
        boxShadow: "0 0 10px rgba(0, 0, 0, 0.1)",  // Fixed property name to camelCase
        alignItems: "center",   // Fixed property name to camelCase
        width: "100%",  // Changed to 100% for responsiveness
        maxWidth: "800px"  // Ensures the image does not exceed 800px
    };

    const [activeProject, setActiveProject] = useState("project1");

    const projects = {
        project1: {
            name: "Stochastic Volatility Model (Heston Model) Simulation",
            imageUrl: "/Figure_1_resized.png",
            githubUrl: "https://github.com/yourusername/project1"
        },
        project2: {
            name: "Implemented Google Page Rank using Markov Decision Process",
            imageUrl: "https://via.placeholder.com/960x400.png?text=Project+2",
            githubUrl: "https://github.com/yourusername/project2"
        },
        project3: {
            name: "Implemented Simple multi-layer perceptron using just numpy",
            imageUrl: "https://via.placeholder.com/600x400.png?text=Project+3",
            githubUrl: "https://github.com/yourusername/project3"
        },
        project4: {
            name: "WIP: Implementing a recommender system using collaborative filtering",
            imageUrl: "https://via.placeholder.com/600x400.png?text=Project+4",
            githubUrl: "https://github.com/yourusername/project4"
        }
    };
 const renderProjectListItems = () => Object.entries(projects).map(([key, project]) => (
        <React.Fragment key={key}>
            <li onClick={() => setActiveProject(key)} className={activeProject === key ? "activelis" : ""}>
                {project.name}
            </li>
            <hr className="proj-hr" />
        </React.Fragment>
    ));

    return (
        <div className="PROJ">
            <h1 className="PROJH">Projects</h1>
            <div className="flex-containerp">
                <div className="proj-list-container">
                    <ul>{renderProjectListItems()}</ul>
                </div>
                <div>
                    <img
                        style={{ width: '100%', maxWidth: '800px' }}
                        src={projects[activeProject].imageUrl}
                        alt="project"
                    />
                    <p>
                        Check out the GitHub link for more details:
                        <a href={projects[activeProject].githubUrl} className="github-link" target="_blank" rel="noopener noreferrer">
                            <FaGithub className="github-icon" />{projects[activeProject].name}
                        </a>
                    </p>
                </div>
            </div>
        </div>
    );
}

export default ProjectsDisplay;
